import React from "react";
import axios from "axios";
import Link from "next/link";

class Zipcodeinput extends React.Component {
  static async getInitialProps() {
    var promise = axios
      .get("http://localhost:4000/zipcodeinput")
      .then(response => {
        return {
          hasErrored: false,
          zipcodeinputData: response.data
        };
      })
      .catch(error => {
        return {
          hasErrored: true,
          message: error.message
        };
      });
    return promise;
  }

  constructor(props) {
    super(props);
    this.state = {
      hasErrored: props.hasErrored,
      message: props.message,
      zipcodeinputData: props.zipcodeinputData
    };
  }

  componentDidMount() {}

  componentWillUnmount() {}

  render() {
    return (
    <div className="container dwi-div dwi-card">
      <div>
        <h5>Challenge #2</h5>
      </div>
      <div className="row">
        <div className="card-deck">

        <div className="card col-12 cardmin margintopbottom dwi-form-section">
          <form>
          <div className="form-group row">
            <div className="col-sm-6">
            <input type="text" name="zipcode" className="form-control" id="inputzipcode" placeholder="Zip Code" />
            </div>
            <div className="col-sm-6">
            {this.state.zipcodeinputData.map((zipcodeinput) =>
              <div className="form-check"  key={zipcodeinput.zipCode}>
              {zipcodeinput.city}, {zipcodeinput.stateAbbrevation} 
              </div>
            )}
            </div>
          </div>
          <div className="form-group row">
            <div className="col-sm-4">
            {/* <button type="submit" className="btn btn-primary mb-2">Go</button> */}
            </div>
            <div className="col-sm-8">
            </div>
          </div>
        </form>
        </div>
      </div>
      </div>
      </div>
    );
  }
}

export default Zipcodeinput;
